import React, { Component, useState } from "react";
import { VictoryLine, VictoryChart } from "victory";
import compHistory from './functions/compHistory';

export default class Tacos extends Component {
  constructor() {
    super();
    const [data, setData] = useState();
    // let chart = compHistory("AAPL", 1)
    // console.log(chart)

    setData(compHistory("AAPL", 1))
    console.log(data)
    }
  render() {
    return (
      <div>
        <h1>Tacos per Day</h1>
        <VictoryChart>
          <VictoryLine
            data={data}
            style={{
              data: {
                stroke: "#02B875"
              }
            }}
          />
        </VictoryChart>
      </div>
    );
  }
}
